VALUES ('3573972003463', 'Biscuits 3 Variétés', 'Biscuits salés : Farine de _blé_, matière grasse végétale (palme), sucre, sel, extrait de malt (_orge_), _lait_ entier en poudre (émulsifiant : lécithine de _soja_), agent de traitement de la farine: L-cystéine anhydre, antioxydant: extrait riche en tocophérols (huile de tournesol), carbonate acide de sodium. Biscuits aux céréales : Farine de _blé_, sucre, mélange de céréales 13,5 % (_seigle_, _épeautre_, _orge_, avoine, mais, riz) matière grasse végétale (palme), dextrose, son de _blé_ et de _seigle_, lactose (_lait_), sel, extrait de malt (_orge_), sirop de sucre candi, _lait_ entier en poudre (émulsifiant : lécithine de _soja_), arômes naturels (dont arôme naturel _noisette_ avec d\'autres arômes naturels), carbonate acide de sodium, antioxydant : extrait riche en tocophérols (huile de tournesol). Biscuits aux pépites de chocolat : Farine de _blé_, pépites de chocolat 12,7% (sucre, pâte de cacao, beurre de cacao, poudre de _lait_ entier, matière grasse laitière anhydre (_lait_), arôme naturel de vanille), sucre, matière grasse végétale (palme), dextrose, poudre de cacao, lactose (_lait_) sel, arômes naturels (dont arôme naturel _noisette_ avec d\'autres arômes naturels) extrait de malt (_orge_), sirop de sucre candi, lait entier en poudre (émulsifiant: lécithine de _soja_), carbonate acide de sodium, antioxydant : extrait riche en tocophérols (huile de tournesol).', 'https://static.openfoodfacts.org/images/products/357/397/200/3463/front_fr.8.400.jpg', '11.2', '6.3', '77.3', '20.2', '2.1', '7.5', '0.55', '0.216535433070866', '', '0');

