VALUES ('3576280232686', 'Saumon sauvage du pacifique en croute', 'généteum oaumomoauuage du pacifique en aoûte étpetlt\' légumes culoinéo dano une oauce au beuue cltèonné, pazfuntée au Rleoang. INGRÉDIENTS Feuilleté garni de saumon sauvage du pacifique* et d\'une préparation aux légumes - Surgelé Produit élaboré par Gartal à Quimper (29), 59 salariés, à partir d\'ingrédients rigoureusement sélectionnés. Pâte feuilletée (50%) [farine de blé, margarine végétale (huiles et graisses végétales de palme, eau, sel, émulsifiant : mono- et diglycérides d\'acides gras, acidifiant : acide citrique), eau, sel, Œufs], saumon sauvage du Pacifique* 20%, eau, poireaux 3,5%, échalotes, tomates 2,3%, crème légère, carottes jaunes 1 ,7%, carottes rouges 1 ,7%, Riesling 1 ,7% (contient des sulfites), beurre 1 ,4%, farine de blé, oignons, poudre de lait entier, amidon modifié de pomme de terre, vinaigre, ciboulette, jus de citron concentré 0,29%, arôme naturel (contient gluten, lait et poisson), sel, poudre de blanc dlŒuf, poivre, curcuma. Traces possibles de mollusques et de crustacés. (Pourcentages exprimés sur le produit fini) Malgré tout le soin apporté à la préparation du saumon, la présence exceptionnelle d\'arêtes n\'est pas exclue. Les informations en gras sont destinées aux personnes intolérantes ou allergiques. *Saumon rose du Pacifique (Oncorhynchus gorbuscha) et/ou Saumon keta du Pacifique (Chum salmon) et/ou Saumon rouge du Pacifique (Oncorhynchus nerka)', 'https://static.openfoodfacts.org/images/products/357/628/023/2686/front_fr.4.400.jpg', '14.7', '7.8', '20.3', '2.7', '', '7.6', '0.86', '0.338582677165354', '', '1');

