VALUES ('3576280631052', '2 Cassolettes', '2 Cassolettes gamies de noix de Saint Jacques* et de crevettes nordiques dans une sauce à la bisque c homard - Surgelées Produit élaboré par Gattal ou Doussot, à Quimper ou Quimperlé (29), 59 ou 15 salariés, à partir d\'ingrédients rigoureusement sélectionné Eau, noix de st jacques* 15,7% (mollusques) (*espèces et origines : voir la lettre près du numéro de lot), crevette nordiques 10,7% (crustacés), carottes jaunes en juliennes 10,5%, crème fraîche légère 7,2% (lait), oignons, beurre (lait) vin blanc (contient sulfites), bisque de homard 2,9% [eau, homard concentré (crustacés), vin blanc (sulfites), crèm fraîche (lait), amidon modifié de manioc, double concentré de tomates, farine de blé (gluten), sel, beurre (lait), Cognac oianons, ail, arôme naturel de poivre, piment], carottes rouges en juliennes 2,9%, poudre de lat entier, farine de blé (gluten), amidon modifié de pomme de terre, Cognac modifié 0,7%, ail, sel, persil, poivre. Traces possibles de poisson. Les informations en gras sont destinées aux personnes intolérantes ou allergiques. Malgré tout le soin apporté à la préparation des noix, la présence exceptionnelle de coques n\'est pas exclue. *Chlamys zygopatagonica, origine Argentine (A), Chlamys opercularis, origine Royaume-Uni (B) ou Iles Féroé (C), Argopectenpurpuratus, origine Pérou (D), Chlamys islandica, origine Canada (E) ou Iles Féroé (F) ou Islande (G) : voir lettre(s) près du numéro de lot', 'https://static.openfoodfacts.org/images/products/357/628/063/1052/front_fr.3.400.jpg', '6.4', '4.4', '5', '2.5', '', '5.4', '0.74', '0.291338582677165', '', '1');

